import "./Movie.css";

interface Movie {
  poster?: string;
  title: string;
  crawl: string;
  date: string;
}

const Movie: React.FC<Movie> = ({ poster, title, crawl, date }) => {
  return (
    <div className="movie__card">
      <img src={poster} alt="Movie Poster" />

      <p>{title}</p>

      <span> Opening crawl:{crawl}</span>
      <span> Release date: {date}</span>
    </div>
  );
};

export default Movie;
